import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'; // Add Link
import SignUp from './components/SignUp';

function App() {
    return (
        <Router>
            <div style={{ textAlign: 'center', padding: '20px' }}>
                {/* Add navigation link to the sign-up page */}
                <nav>
                    <Link to="/signup" style={styles.link}>Sign Up</Link>
                </nav>
                <Routes>
                    <Route path="/signup" element={<SignUp />} />
                    <Route path="/" element={<h1>Welcome to FanNation</h1>} />
                </Routes>
            </div>
        </Router>
    );
}

// Basic styling for the link
const styles = {
    link: {
        fontSize: '18px',
        color: '#4CAF50',
        textDecoration: 'none',
        padding: '10px 20px',
        border: '1px solid #4CAF50',
        borderRadius: '4px',
    },
};

export default App;
